import React from "react";
import { Link } from "react-router-dom";
import { Box, Typography } from "@material-ui/core";
import "../App.css";

const Home = () => {
  return (
    <div className="App">
      <header className="App-header">
        <img
          src={process.env.PUBLIC_URL + "/resources/pik.png"}
          width="600"
          alt="poke"
        />
        <h1>Poke App</h1>
        <Link to="/pokemons">Ver Pokemons</Link>
      </header>
      <div className="Background-Img1">
        <Typography>Todo Sobre Pok√©mon</Typography>
        <Box color="text.primary"></Box>
      </div>
    </div>
  );
};

export default Home;
